import React, { Component } from "react";
import "./forestanim.css";

class ForestAnim extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return <div className='sizer6'><div className="grass"></div></div>;
  }
}

export default ForestAnim;
